  "geo" : {
  },
  "id_str" : "161065498283479040",
  "text" : "フリーコンテントな界隈の人間としては、 http://t.co/b1jjppT8 のような感じで著作権者が著作物をフリーで利用できないようにする側に回ってしまうことは非常に残念なので、「無断転載どうこう」って話を見るたびに、CCとか何かできることはないのかなぁと考える。 [n]",
  "id" : 161065498283479040,
