  "geo" : {
  },
  "id_str" : "158754682225958912",
  "text" : "非著作権保持者が作品を勝手にライセンスしてしまう話は、他のフリーライセンスでも昔からよく聞く話。それは、故意にやるというよりは過失（ライセンスや著作権に関する知識・認識が甘すぎることなど）によるものも多い。 http://t.co/8mzZfWP4",
