  "text" : "『Another』の感想：某友人が「お前みたいな推理モノ好きにオススメ」と言ってたので読んでみましたが、ただのホラーでした。何が起きてたのか、誰なのかも、推理は割と簡単だった。最後の暴走はちょっと強引な感じ。確かにアニメ・映画向きではあるかも。変な恋愛描写がないのは○。",
