  "text" : "「ゴリ」という猫ぐらいの大きさで丸っこい生き物？が丸い物体をぶつけてきて、頑張って倒したら、「リラ」というのに進化して、「ピカー！」（スマブラのピカチュウの雷の時の声）って言うと、さっきの丸い物体めがけて電気が流れる攻撃された。それを頑張って避けつつ木の上を移動した。",
