  "text" : "実際の会話：「コウセン出身なんですか、何科でしたか？」「環境都市です」「えっ」「えっ」「編入試験ってどういうのなんですか？」「コウセン枠ってありましてね」「えっ」「えっ」「ちなみに・・・高校はどこでした？」「え、だからコウセンですって」「えっ」「えっ」 [n]",
